import React from "react";

// const ZWSID = "X1-ZWz1hiqiaku2ob_1pt0f";

function Zillow() {
  fetch("https://zillowdimashirokovv1.p.rapidapi.com/GetSearchResults.htm", {
    method: "POST",
    headers: {
      "x-rapidapi-host": "ZillowdimashirokovV1.p.rapidapi.com",
      "x-rapidapi-key": "41f3f91b13mshaa0652a8c3b96f1p165abcjsn42e270cab71c",
      "content-type": "application/x-www-form-urlencoded",
    },
    body: {
      rentzestimate: false,
      "zws-id": "X1-ZWz1hiqiaku2ob_1pt0f",
    },
  })
    .then((response) => {
      return response.text();
    })
    .then(function (data) {
      console.log(data);
    })
    .catch((err) => {
      console.log(err);
    });

  return (
    <div>
      <h1>Hello</h1>
    </div>
  );
}

export default Zillow;
